import React from "react";
import PropTypes from "prop-types";

import Input from "../../../../../components/Input";

import {
  Container,
  Background,
  Opacity,
  Emblem,
  Column,
  Form,
  Label,
  Button,
  CPF,
  Save,
} from "./styles";

function Index({
  username,
  setUsername,
  name,
  setName,
  email,
  setEmail,
  password,
  setPassword,
  cpf,
  setCpf,
}) {
  return (
    <Container>
      <Background />
      <Opacity />
      <Column>
        <Form>
          <Emblem />
          <Input
            placeholder="usuÃ¡rio"
            value={username}
            onChange={(event) => setUsername(event.target.value)}
            marginTop={30}
          />
          <Input
            placeholder="nome"
            value={name}
            onChange={(event) => setName(event.target.value)}
            marginTop={30}
          />
          <Input
            placeholder="senha"
            value={password}
            onChange={(event) => setPassword(event.target.value)}
            marginTop={30}
            type="password"
          />
          <Input placeholder="e-mail" marginTop={30} />
          <CPF placeholder="CPF" />
          <Button background="#424242" marginTop={50}>
            <Save />
          </Button>
        </Form>
      </Column>
      <Column>
        <Label>Seja bem-vindo ao inferno</Label>
        <Button marginTop={30} marginLeft={50} to="/signIn">
          voltar
        </Button>
      </Column>
    </Container>
  );
}

export default Index;
